import React, { forwardRef } from "react";
import numbersign from '../../assets/images/numbersign.png';
import "./DropItem.css";

export default forwardRef(({ children, heading }, ref) => {
  console.log(children);
  console.log(children.length);
  return (
    <div className="container" style={{ height: (children * 2) + 'rem' }} ref={ref}>
      <p>
        <img src={numbersign} alt="channel" height={18} width={18} />
        <span>{heading}</span>
      </p>
      {/* <h3>{heading}</h3>
      <div className="body">{children}</div> */}
    </div>
  );
});
